Creates a [`SmallVec`] containing the arguments.

`smallvec!` allows `SmallVec`s to be defined with the same syntax as array expressions.
There are two forms of this macro:

- Create a [`SmallVec`] containing a given list of elements:

```
# #[macro_use] extern crate smallvec;
# use smallvec::SmallVec;
# fn main() {
let v: SmallVec<[_; 128]> = smallvec![1, 2, 3];
assert_eq!(v[0], 1);
assert_eq!(v[1], 2);
assert_eq!(v[2], 3);
# }
```

- Create a [`SmallVec`] from a given element and size:

```
# #[macro_use] extern crate smallvec;
# use smallvec::SmallVec;
# fn main() {
let v: SmallVec<[_; 0x8000]> = smallvec![1; 3];
assert_eq!(v, SmallVec::from_buf([1, 1, 1]));
# }
```

Note that unlike array expressions this syntax supports all elements
which implement [`Clone`] and the number of elements doesn't have to be
a constant.

This will use `clone` to duplicate an expression, so one should be careful
using this with types having a nonstandard `Clone` implementation. For
example, `smallvec![Rc::new(1); 5]` will create a vector of five references
to the same boxed integer value, not five references pointing to independently
boxed integers.

1:7153:2857.docs:
Takes two iterators and creates a new iterator over both in sequence.

`chain()` will return a new iterator which will first iterate over
values from the first iterator and then over values from the second
iterator.

In other words, it links two iterators together, in a chain. 🔗

[`once`] is commonly used to adapt a single value into a chain of
other kinds of iteration.

# Examples

Basic usage:

```
let a1 = [1, 2, 3];
let a2 = [4, 5, 6];

let mut iter = a1.iter().chain(a2.iter());

assert_eq!(iter.next(), Some(&1));
assert_eq!(iter.next(), Some(&2));
assert_eq!(iter.next(), Some(&3));
assert_eq!(iter.next(), Some(&4));
assert_eq!(iter.next(), Some(&5));
assert_eq!(iter.next(), Some(&6));
assert_eq!(iter.next(), None);
```

Since the argument to `chain()` uses [`IntoIterator`], we can pass
anything that can be converted into an [`Iterator`], not just an
[`Iterator`] itself. For example, slices (`&[T]`) implement
[`IntoIterator`], and so can be passed to `chain()` directly:

```
let s1 = &[1, 2, 3];
let s2 = &[4, 5, 6];

let mut iter = s1.iter().chain(s2);

assert_eq!(iter.next(), Some(&1));
assert_eq!(iter.next(), Some(&2));
assert_eq!(iter.next(), Some(&3));
assert_eq!(iter.next(), Some(&4));
assert_eq!(iter.next(), Some(&5));
assert_eq!(iter.next(), Some(&6));
assert_eq!(iter.next(), None);
```

If you work with Windows API, you may wish to convert [`OsStr`] to `Vec<u16>`:

```
#[cfg(windows)]
fn os_str_to_utf16(s: &std::ffi::OsStr) -> Vec<u16> {
    use std::os::windows::ffi::OsStrExt;
    s.encode_wide().chain(std::iter::once(0)).collect()
}
```

