Returns the product of the lanes of the vector, with wrapping multiplication.

# Examples

```
# #![feature(portable_simd)]
# #[cfg(feature = "as_crate")] use core_simd::simd;
# #[cfg(not(feature = "as_crate"))] use core::simd;
# use simd::{i32x4, SimdInt};
